import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

export default function MovieTags({ tags }) {
  return (
    <div className="tags">
      <strong>Từ khóa :</strong>
      <ul className="list">
        {
          tags && tags.map((item)=>{
            return <li className="tag"><Link to={`/tu-khoa/${'item'}`}>{item}</Link></li>
          })
        }
      </ul>
    </div>
  );
}
